            let writeReturn = { uniffiOutReturn.pointee = FfiConverterTypeLoroValue.lower($0) }
            uniffiTraitInterfaceCall(
                callStatus: uniffiCallStatus,
                makeCall: makeCall,
                writeReturn: writeReturn
